description:
बेलायतका वरिष्ठ राजनीतिज्ञ लर्ड पिटर मन्डलसनले लेबर पार्टीको सदस्यताबाट राजीनामा दिएका छन्।&amp;nbsp;

चर्चित यौन अपराधी जेफ्री एपस्टिनसँगको उनको विवादास्पद सम्बन्ध र आर्थिक लेनदेनका नयाँ तथ्यहरू सार्वजनिक भएपछि उनले यो निर्णय लिएका हुन्।

अमेरिकी न्

नेपाल राष्ट्र बैंकले आजका लागि विदेशी मुद्राको विनिमयदर निर्धारण गरेको छ । निर्धारण गरिएको विनिमयदर अनुसार अमेरिकी डलर एकको खरिददर १४६ रुपैयाँ ८८ पैसा र बिक्रीदर १४७ रुपैयाँ ४८ पैसा तोकिएको छ ।&amp;nbsp;
&amp;nbsp;&amp;nbsp; &amp;nbsp;
त्यसैगरी युरोप
